import React from "react";
import GoogleMapReact from 'google-map-react';

export const GoogleMaps = () => {
    const containerStyle = {
        width: "100%",
        height: "100vh",
    }

    const center = {
        lat: 28.626137,
        lng: 79.821603,
    }

    return (
        <LoadScript googleMapsApiKey='AIzaSyBhVXUVndfSpP7dLmTY0mgQskPu4hWADOw'>
            <GoogleMap
                mapContainerStyle={containerStyle}
                center={center}
                zoom={15}
            >
                <HeatmapLayer data={new google.maps.LatLng(37.782, -122.447)} />
            </GoogleMap>
        </LoadScript>
    );
};
